import React from 'react';

const CardJouet = props => {
  return (
    <div>
      <h2>{props.seller}</h2>
      <h1>{props.title}</h1>
      <h5>{props.description}</h5>
      <button>Voir produit</button>
      <img src="" alt=""/>
    </div>
  )
};

export default CardJouet
